import React from 'react';
import StatusTable from './components/StatusTable';
import FiltInfoTable from './components/FiltInfoTable';
import DailyScheduleTable from './components/DailyScheduleTable';
import TargetForm from './components/TargetForm'
import WavelengthVisualization from './components/WavelengthVisualization'
import './App.css';

function App() {
    return (
        <div className="app-container">
            <div className="component-box">
                <TargetForm />
            </div>
            <WavelengthVisualization/>
            <h2>Observatory Dashboard</h2>
            {/* First row: StatusTable and FiltInfoTable */}
            <div className="row-container">
                <div className="component-box">
                    <StatusTable />
                </div>
                <div className="component-box">
                    <FiltInfoTable />
                </div>
            </div>
            {/* Second row: DailyScheduleTable */}
            <div className="row-container">
                <div className="component-box">
                    <DailyScheduleTable />
                </div>
            </div>

        </div>
    );
}

export default App;
